" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Clinical features and diagnosis of leptomeningeal metastases from solid tumors",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?23/48/24329/contributors\">",
