"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Basic lab tests - CBC, Biochemical screen, AST, ALT, GGT, PT, PTT",
"       </td>",
