var title_f23_48_24332="Modified Bell staging NEC";
var content_f23_48_24332=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F54166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F54166&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Modified Bell staging criteria for necrotizing enterocolitis (NEC) in neonates",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"5%\">",
"     </colgroup>",
"     <colgroup span=\"4\" width=\"23%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stage",
"       </td>",
"       <td class=\"subtitle1\">",
"        Classification of NEC",
"       </td>",
"       <td class=\"subtitle1\">",
"        Systemic signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Abdominal signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Radiographic signs",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IA",
"       </td>",
"       <td>",
"        Suspected",
"       </td>",
"       <td>",
"        Temperature instability, apnea, bradycardia, lethargy",
"       </td>",
"       <td>",
"        Gastric retention, abdominal distention, emesis, heme-positive stool",
"       </td>",
"       <td>",
"        Normal or intestinal dilation, mild ileus",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IB",
"       </td>",
"       <td>",
"        Suspected",
"       </td>",
"       <td>",
"        Same as above",
"       </td>",
"       <td>",
"        Grossly bloody stool",
"       </td>",
"       <td>",
"        Same as above",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IIA",
"       </td>",
"       <td>",
"        Definite, mildly ill",
"       </td>",
"       <td>",
"        Same as above",
"       </td>",
"       <td>",
"        Same as above, plus absent bowel sounds with or without abdominal tenderness",
"       </td>",
"       <td>",
"        Intestinal dilation, ileus, pneumatosis intestinalis",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IIB",
"       </td>",
"       <td>",
"        Definite, moderately ill",
"       </td>",
"       <td>",
"        Same as above, plus mild metabolic acidosis and thrombocytopenia",
"       </td>",
"       <td>",
"        Same as above, plus absent bowel sounds, definite tenderness, with or without abdominal cellulitis or right lower quadrant mass",
"       </td>",
"       <td>",
"        Same as IIA, plus ascites",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        IIIA",
"       </td>",
"       <td>",
"        Advanced, severely ill, intact bowel",
"       </td>",
"       <td>",
"        Same as IIB, plus hypotension, bradycardia, severe apnea, combined respiratory and metabolic acidosis, DIC, and neutropenia",
"       </td>",
"       <td>",
"        Same as above, plus signs of peritonitis, marked tenderness, and abdominal distention",
"       </td>",
"       <td>",
"        Same as IIA, plus ascites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IIIB",
"       </td>",
"       <td>",
"        Advanced, severely ill, perforated bowel",
"       </td>",
"       <td>",
"        Same as IIIA",
"       </td>",
"       <td>",
"        Same as IIIA",
"       </td>",
"       <td>",
"        Same as above, plus pneumoperitoneum",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     DIC: disseminated intravascular coagulation.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Neu J. Necrotizing enterocolitis: the search for a unifying pathogenic theory leading to prevention. Pediatr Clin North Am 1996; 43:409.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
