"   <div class=\"cntnt\" style=\"width: 523px; height: 387px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Parathyroid hormone (PTH) is an 84-amino acid polypeptide secreted by the parathyroid glands. It has an N-terminal (H2N) and a C-terminal region (COOH). PTH 1-34 is shown in yellow; PTH 1-84 is the full-length polypeptide.",
